/* eslint-disable */ 
import './App.css';
import { useState } from 'react';

function App() { //jsx 문법 => 자바스크립트 안에 html 사용가능.

  let 제목 = "KH D CLASS";

  //state 문법
  let [제목2, 제목변경함수] = useState('KH E CLASS');  //['KH E CLASS' , function ] 
  // 관례 : let [title, setTitle] <= set을 붙이는 것이 관례다.
  /*
    비구조화 할당 문법 : 배열이나 객체에 들어가 있는 값을 "쉽게" 변수로 할당하는 문법

    let arr = {1,2};
    let a   =[0];
    ley b   =[1];

    let [a,b] = arr;

    useState()함수의 반환값은 길이 2짜리 배열[]이며, 배열 비구조화 할당 문법을 통해 쉽게 배열에 있는 값을
    변수로 할당한 것,
    반환된 배열의 0번 인덱스에 있는 값을 제목2 변수에, 1번 인덱스에 있는 값을 제목변경 함수에 각각 할당한 것.

    인스타 좋아요 방식, 클라이언트가 눌렀을 때 즉시 효과가 나는 것에 쓰이면 좋다.

  */

    let [게시글배열, 게시글배열변경함수] = useState([{ 글번호: 1, 글제목: '초기게시글 1', 글내용: '다이어트3주차 힘드네요', 작성자: 'admin', 작성일: '2023/12/27'},
            { 글번호: 2, 글제목: '다이어터 식단표 공유', 글내용: '아침 : 삼각김밥, 점심 : 김밥반줄, 저녁 : 삼각김밥', 작성자: 'admin', 작성일: '2023/12/27'},
            { 글번호: 3, 글제목: '다이어트끝나면(1)', 글내용: '편백찜 먹고싶다', 작성자: 'admin', 작성일: '2023/12/27' },
            { 글번호: 4, 글제목: '다이어트끝나면(2)', 글내용: '스키야끼 먹고싶다', 작성자: 'admin', 작성일: '2023/12/27'},
            { 글번호: 5, 글제목: '다이어트끝나면(3)', 글내용: '타코 먹고싶다', 작성자: 'admin', 작성일: '2023/12/27' },
            { 글번호: 6, 글제목: '대충만든 제목', 글내용: '대충만든 글내용', 작성자: 'admin', 작성일: '2023/12/27' },
            { 글번호: 7, 글제목: '다이어트끝나면(4)', 글내용: '치킨 피자 먹고싶다', 작성자: 'admin', 작성일: '2023/12/27' },
            { 글번호: 8, 글제목: '다이어트끝나면(5)', 글내용: '초밥 먹고싶다', 작성자: 'admin', 작성일: '2023/12/27' },
            { 글번호: 9, 글제목: '다이어트끝나면(6)', 글내용: '햄버거 먹고싶다', 작성자: 'admin', 작성일: '2023/12/27' },
            { 글번호: 10, 글제목: '오늘은 무슨날?', 글내용: '치팅데이', 작성자: 'admin', 작성일: '2023/12/29' },
  ]);


    function 제목2변경 () {
      // 제목2 = "KH C CLASS"; // 단순 대입연산자를 활용하는 경우 state값의 변경점을 reactDom이 알지 못함
      제목변경함수("KH C CLASS"); // useState의 두 번째 매개변수로 전달받은 함수를 통해 변경시 화면이 재렌더링한다.
    }



  return (
    <div className="App">
      {/* 
          jsx문법 내부에서의 주석
          jsx문법) 
          js문법 내부에 html 코드를 작성할 수 있는 문법을 jsx문법이라고 한다.
          리액트에서 ui를 구성할 때 보편적으로 사용되는 방법으로 복잡한 코드를 짤 필요 없이,
          동적으로 추가되는 dom 요소를 단순 코드선언으로 생성할 수 있게 도와준다.
      */}
      <div className="header">
            <h3 style={ { fontWeight : "bolder"}  }>{제목2}</h3>
      </div>
      <div className='nav'>
        {/* 
           react방식 event 부여
           onClick 내부에는 무조건 함수가 들어가야 한다.
            => onClick={함수}
            *주의점 : 무조건 함수자료형 값만 넣어줘야함. 함수 호출한 결과값 넣어주면 의미가 없다.
        */}
          <button onClick={제목2변경}>제목 변경 테스트</button>
          <button>게시판</button>
          <button>등록</button>
      </div>
      <div className='outer'>
        <br/>
        <h2>일반게시판</h2>
        <table className='list-table'>
          <thead>
            {/*  번호, 제목, 작성자, 작성일 , 삭제에 각각 
            크기 10%    40%   20%   20%      10% 수정  */}
            <tr>
              <th style={ {width : "10%" }}>번호</th>
              <th style={ {width : "40%" }}>제목</th>
              <th style={ {width : "20%" }}>작성자</th>
              <th style={ {width : "20%" }}>작성일</th>
              <th style={ {width : "10%" }}>삭제</th>
            </tr>
          </thead>
          <tbody>
            {/* 
               Array내부의 map함수를 사용 예정
            */

                게시글배열.map(function( 게시글, 인덱스) {


                  return (
                  <tr >
                    <td>{게시글.글번호}</td>
                    <td>{게시글.글제목}</td>
                    <td>{게시글.작성자}</td>
                    <td>{게시글.작성일}</td>
                    <td><button>삭제</button></td>
                  </tr>
                  )
                } )

            } 

          </tbody>

        </table>
      </div>
    </div>
  );
}

export default App;
